import Row from "./Row";
const styles = {
  pagesNumber: {
    listStyle: "none",
    display: "flex",
    color: "blue",
    userSelect: "none",
    cursor: "pointer",
  }
};
export default function Table({ items, renderHeader, renderPageNumbers }) {
  return (
    <>
    <table>

      <tbody>
      {renderHeader()}
        {items.map(item => (
          <Row human={item} key={`${item.id}:${item.firstName}-${item.lastName}`} />
        ))}
      </tbody>
    </table>
    <ul style={styles.pagesNumber}>
              {renderPageNumbers}
            </ul>
</>
  );
}
